import React from 'react'
import Post from './post'
import feeds from './postdata'



function MyApp (){
    const Newfeed = feeds.map (function (talk){
        return(
            <div>
                <post
                    question = {talk.question}
                    answer = {talk.answer}
                    key = {talk.id}
                />
            </div>
        )
    })
    return(
        <div>
            {Newfeed}
        </div>
    )
}
 
export default MyApp;
